  [],\n\t\"num_tags\": 0,\n\t\"name\": \"currents-temperature-and-salinity-data-recorded-continuously-from-may-12-2010-to-december-16-20\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The dataset contains ADCP Workhorse Long
  Ranger current records from 50 to 950m depth and Seabird CTD at 20, 80, 130, 230,
  500, 850, and 1000m, recorded continuously from May-Dec of 2010. The raw data files
  are about 250MB in total. The mooring was sponsored by Naval Facilities Command
  Engineering Service Center (NAVFAC) at Port Hueneme, CA, and Sound and Sea Technology,
  with additional instrumentation provided by Makai Ocean Engineering and deployment
  and planning by Todd Erickson of the School of Ocean and Earth Science and Technology,
  University of Hawaii. The unprocessed raw ASCII files have self explanatory headers.
  The data are clean and do not require any filtering or de-spiking. The same data
  are also available as a Matlab file (67MB), which has had minimal processing other
  than interpolating short time gaps.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
